import React from 'react';
import classes from './FAQ_preview.module.css'
import {questions} from './FAQ_Data'
import { HashLink } from 'react-router-hash-link';


const FAQ_preview = () => {

	const FAQ_nav = questions.map( (item) => 

	<div className = {classes.question} key = {item.id} id= {item.id}>
		
			<div className={classes.wrapper}>
				<div className={classes.img}>
				<img src={item.logo} alt='logo' height={50} ></img>
				</div>
			<p className={classes.title}>{item.title}</p>
			
			<button>See Answer</button>
	
		</div>
	</div>
	)

return(
	<div>
   <div className={classes.header}>
   <p className={classes.title}>My profile</p> 
		{/* <Back/> */}
		</div>
  {FAQ_nav}
	</div>
)
}



export default FAQ_preview;
